import './App.css';
import * as React from 'react';
import NavBar from './components/NavBar.js';
import Button from '@mui/material/Button';

function App() {
  return (
    <div>
      <Button variant="outlined">Hello World</Button>
    </div>
  );
}


function TextArea() {
  return (
    <textarea></textarea>
  );
}

export default App;
